import React, { Fragment } from 'react';
import { Navbar, Container, Columns } from 'react-bulma-components';
import styled from 'styled-components'


const NavbarWithBorder = styled(Navbar)`
  border-top-color: white !important;
  border-top-style: solid;
  border-top-width: 1px;
`

const ColumnsFullWidth = styled(Columns)`
  width: 100%;
  padding-top: 10px;
`

const NavbarFooter = () => {

  return (
    <Fragment>
        <NavbarWithBorder fixed='bottom' color='dark'>
            <Container>
                <Columns.Column className='is-mobile is-vcentered'>
                    <Columns.Column className='has-text-centered'>

                    </Columns.Column>

                    <Columns.Column className='has-text-centered'>

                    </Columns.Column>

                    <Columns.Column className='has-text-centered'>

                    </Columns.Column>
                </Columns.Column>    
            </Container>
        </NavbarWithBorder>  
    </Fragment>
  );
}
export default NavbarFooter;
